import React from 'react';
import './Intro.css';
import Card from './Card';
import img1 from '../../images/one.jpeg';

export default function Intro(){
  return(
    <>
         <div className="i">
           <div className="i-wrapper">
              <div className="card1">
                <img src={img1} alt="" />
              </div>
              <div className="card2">
                 <Card />
              </div>
           </div>
         </div>
    </>
  )
}
